import React from 'react';

const ContactView = () => (
	<div className="wrapper contact-wrapper">
		<div className="contact-content">
			<h1>Kontakt</h1>
			<h2>
				Jestem dostępny dla firm , agencji kreatywnych <br />
				oraz osób prywatnych
			</h2>
		</div>
	</div>
);

export default ContactView;
